css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label/*_icon*/ > I {display: none !important}
.new_post_label {
  color: transparent !important;
  background-clip: content-box;
  padding: 40px 1px 39px 0 !important;
}
.new_post_label:hover {
  color: white !important;
  background-color: rgba(0,0,0,.7) !important;
  font-weight: bold !important;
}
.new_post_buttons {
  background: white center no-repeat url('data:image/png;base64,') !important;
}

}
